contracts/8001/ERC20/ERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;
import "./IERC20.sol";// 状态变量
import "../../03/IERC165.sol";

contract ERC20 is IERC20 {

    string public name;
    string public symbol;
    uint8 public immutable decimals;
    address public immutable owner;
    // uint256 public immutable totalSupply; // 不增加总量
    uint256 public totalSupply; // 总价总量
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;  // 第一个地址授权第二个地址剩余授权额度

    // 函数修改器
    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }
    // 构造函数
    constructor(string memory _name, string memory _symbol, uint8 _decimals, uint256 _totalSupply) {
        owner = msg.sender;
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
        totalSupply = _totalSupply;
        balanceOf[msg.sender] = _totalSupply;
        emit Transfer(address(0), msg.sender, _totalSupply);
    }
    // 1个授权
    function approve(address spender, uint256 amount) external returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }
    // 2个交易 msg.sender 转给 recipient
    function transfer(address recipient, uint256 amount) external returns (bool) {
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool) {
        // msg.sender 也就是当前调用者，是被批准者
        allowance[sender][msg.sender] -= amount;
        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

    // 1个铸币 - 非必须
    function mint(uint256 amount) external onlyOwner returns (bool) {
        totalSupply += amount;
        balanceOf[msg.sender] += amount;
        emit Transfer(address(0), msg.sender, amount);
        return true;
    }

    // 1个销毁 - 非必须
    function burn(uint256 amount) external returns (bool) {
        totalSupply -= amount;
        balanceOf[msg.sender] -= amount;
        emit Transfer(msg.sender, address(0), amount);
        return true;
    }
    // 转移 owner 权限等其他一些操作均是看各自业务，非必需的

}

contracts/03/IERC165.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

// 查询某个合约是否支持某个接口，采用函数选择器的方式，interfaceId是某个接口的keccak256的签名
// 开发NFT市场或者钱包，通过ERC165查询某个合约是否支持ERC721和ERC115标准，以决定如何与该合约交互
interface IERC165 {

    function supportsInterface(bytes4 interfaceId) external view returns (bool);

}

contracts/8001/ERC20/IERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

interface IERC20 {

    // 标准 ERC20 接口
    // 3 个查询

    // balanceOf: 查询指定地址的 Token 数量
    // totalSupply: 查询当前合约的 Token 总量
    // allowance: 查询指定地址对另外一个地址的剩余授权额度
    // 2 个交易

    // transfer: 从当前调用者地址发送指定数量的 Token 到指定地址。
    // 这是一个写入方法，所以还会抛出一个 Transfer 事件。
    // transferFrom: 当向另外一个合约地址存款时，对方合约必须调用 transferFrom 才可以把 Token 拿到它自己的合约中。
    // 2 个事件

    // Transfer
    // Approval
    // 1 个授权

    // approve: 授权指定地址可以操作调用者的最大 Token 数量。

    // 1个授权
    function approve(address spender, uint256 amount) external returns (bool);

    // 2个事件
    event Transfer(address indexed from, address indexed to, uint256 amount);

    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 amount
    );

    // 2个交易
    function transfer(address recipient, uint256 amount)external returns (bool);

    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);

    // 3个查询
    function totalSupply() external view returns (uint256);

    function balanceOf(address account) external view returns (uint256);

    function allowance(address owner, address spender)external view returns (uint256);

}

